import React from 'react'
import '../../../../Styles/Home/Grid/Contact/Contact.css'

const Contact = () => {
    return (
        <main className="main">
            <div className="about-me">
                About Me
            </div>
            <div className="contact">
                Contact Me
            </div>
        </main>
    );
}


export default Contact;
